import React, { Component } from 'react';
import { Table, Container } from 'react-bootstrap';

class Company extends Component {
  constructor(props) {
    super(props);
    this.state = {
      employees: [
        {
          Name: 'eduk',
          Address: 'bgc',
          Description: 'enk'
        },
        {
          Name: 'next',
          Address: 'remote',
          Description: 'wuho'
        },
        {
          Name: 'rt',
          Address: 'dela rosa',
          Description: 'mmm'
        },
        {
          Name: 'io',
          Address: 'pacific',
          Description: 'boo'
        },
      ]
    };
    this.getCompanies = () => {
      fetch('http://localhost:1337/companies', {

      }).then(res => {
        console.log(res)
      });
    }
  }
  componentDidMount() {
    this.getCompanies()
  }
  render(){
    return (
      <Container>
        <h1>Company</h1>
        <h3>Welcome to NF Company Management System</h3>
        <Table striped responsive>
          <thead>
            <tr>
              <th>Name</th>
              <th>Address</th>
              <th>Description</th>
            </tr>
          </thead>
          <tbody>
          {
            this.state.employees.map(e => {
              return (
                <tr>
                  <td>{ e.Name }</td>
                  <td>{ e.Address }</td>
                  <td>{ e.Description }</td>
                </tr>
              )
            })
          }
          </tbody>
        </Table>
      </Container>
    );
  }
}

export default Company
